import React, { useEffect, useState, useContext, Fragment } from "react";
import styles from "./HomeRestaurant.module.css";
import UserContext from "../userContext";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import ButtonBase from "@material-ui/core/ButtonBase";



export default function HomeRestaurant() {
  const userContext = useContext(UserContext);
  const [offertsArray, setOffertsArray] = useState({});

  useEffect(() => {
    fetchOfferts();
  }, []);

  const fetchOfferts = () => {
    fetch(
      "http://localhost:4000/restaurant/offerts",
      {
        method: "GET",
        mode: "cors",
        cache: "no-cache",
        headers: {
          "Content-Type": "application/json",
          Authorization: userContext.user.token,
        },
      }
    )
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        setOffertsArray(json.offertsArray);
      })
      .catch((err) => console.log("err", err));
  };


  return (
    <div className={styles.Login}>
        {/* <NavBar></NavBar> */}
        {/* <Link to="/register">Register</Link> */}
    </div>
  );
}
